import axios from 'axios';
import DashboardMenuItem from "../../../Components/Dashboard/SideWidgets/Dashboards/DashboardMenuItem";

export default async function fetchDashboards(){
let dashboards =[];
    async function fetchData(){
        let requestString = 'http://data.tickdash.io/dashboard';
        let myJson = await axios.get(requestString);
        return myJson;
    }
        fetchData().then(result => {
                for (const [index, value] of result.data.entries()) {

                    dashboards.push(value["title"]);
                }


        });


    return dashboards;

}

